timelion 
  ".es(index=kibana_sample_data_ecommerce, metric=sum:taxless_total_price, timefield=order_date)" interval="2d" 
  from={essql "SELECT order_date as min FROM kibana_sample_data_ecommerce order by order_date limit 1" | getCell "min"} 
  to={essql "SELECT order_date as max FROM kibana_sample_data_ecommerce order by order_date DESC limit 1" | getCell "max"}
| pointseries x="@timestamp" y="value"
| plot yaxis=true defaultStyle={seriesStyle points="0" bars="100000000" lines="0" color="#fd7643"} 
  font={font family="Avenir" size=12 align="left" color="#FFFFFF" underline=false italic=false weight="bold"} xaxis=true
| render

timelion 
  ".es(index=kibana_sample_data_ecommerce, metric=sum:taxless_total_price, timefield=order_date)" interval="1w"
| mapColumn "value" fn={math "round(value,0)"}
| staticColumn "mean" value={math "round(mean(value),0)"}
| mapColumn "mean" "as" "rnd" fn={math "round(random(0.9,1.1),2)"}
| mapColumn "value" "as" "final" fn={math "round(multiply(rnd,mean),2)"}
| pointseries x="@timestamp" y="final"
| plot xaxis=false yaxis=false defaultStyle={seriesStyle points="0" bars="0" lines="3" color="#f2bc33"}
| render

